import React, { useState } from 'react';
import { MapContainer, TileLayer, ZoomControl } from 'react-leaflet';
import L from 'leaflet';
import IconMarkersLayer from './IconMarkersLayer';
import CustomPopup from './CustomPopup';
import '../styles/layout.css';

delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const MapComponent = ({ markers = [], selectedRegion = 'Metropolitana', regions = [] }) => {
  const [selectedPopup, setSelectedPopup] = useState(null);

  const handleMarkerClick = (marker) => {
    setSelectedPopup(marker);
  };

  const handleClosePopup = () => {
    setSelectedPopup(null);
  };

  // Validar que markers es un array
  if (!Array.isArray(markers)) {
    return <div className="map-error">Error: datos de marcadores no v√°lidos</div>;
  }

  // Calcular estad√≠sticas
  const regionMarkers = markers.filter(m => m?.Region === selectedRegion);
  const uniqueMarkers = [...new Set(regionMarkers.map(m => m?.id))].length;
  const markersByBrand = {};
  
  regionMarkers.forEach(m => {
    if (m?.Marca) {
      markersByBrand[m.Marca] = (markersByBrand[m.Marca] || 0) + 1;
    }
  });

  return (
    <div className="map-wrapper">
      {/* Panel izquierdo - Informaci√≥n */}
      <div className="info-panel">
        <div className="panel-header">
          <h2>üìç Gasolineras</h2>
          <p>{selectedRegion}</p>
        </div>

        <div className="panel-content">
          <div className="info-section">
            <h3>Estad√≠sticas</h3>
            <div className="stats-grid">
              <div className="stat-card">
                <span className="stat-label">Regi√≥n</span>
                <span className="stat-value">{selectedRegion}</span>
              </div>
              <div className="stat-card">
                <span className="stat-label">Estaciones</span>
                <span className="stat-value">{uniqueMarkers}</span>
              </div>
            </div>
          </div>

          <div className="info-section">
            <h3>Por Marca</h3>
            <div className="brands-list">
              {Object.entries(markersByBrand)
                .sort((a, b) => b[1] - a[1])
                .map(([brand, count]) => (
                  <div key={brand} className="brand-item">
                    <span className="brand-name">{brand}</span>
                    <span className="brand-count">{count}</span>
                  </div>
                ))}
            </div>
          </div>

          <div className="info-section">
            <h3>Acciones</h3>
            <button 
              className="btn-clear-cache"
              onClick={() => {
                localStorage.removeItem('markersCache');
                window.location.reload();
              }}
            >
              üóëÔ∏è Limpiar Cache
            </button>
          </div>
        </div>
      </div>

      {/* Mapa */}
      <div className="map-container">
        <MapContainer
          center={[-33.8688, -70.9123]}
          zoom={10}
          style={{ height: '100%', width: '100%' }}
          zoomControl={false}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a>'
          />
          <ZoomControl position="bottomright" />
          
          {Array.isArray(markers) && markers.length > 0 && (
            <IconMarkersLayer 
              markers={markers} 
              selectedRegion={selectedRegion}
              onMarkerClick={handleMarkerClick}
            />
          )}
        </MapContainer>

        {/* Popup Custom */}
        {selectedPopup && (
          <CustomPopup 
            marker={selectedPopup} 
            onClose={handleClosePopup}
            isOpen={true}
          />
        )}
      </div>
    </div>
  );
};

export default MapComponent;
